  \"2013-03-16T01:21:50.518840\",\n\t\"name\": \"minnesota-borehole-lithology-intervals\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains lithology log interval
  observations associated with a borehole collected for the State of Minnesota for
  use by the AASG Geothermal Data Project. Fields in the BoreholeLithIntervalTemplate
  will become XML elements in interchange documents for WFS simple features served
  by AASG geothermal data web services. Each interval feature has a top and a bottom,
  measured from the ground surface (convention for interoperability) and a geologic
  unit description that will be identical with the content associated with polygons
  on a geologic map. Other sheets in the workbook provide additional explanatory material
  and provide information on the origin of the dataset, its review and lineage. Link
  to Borehole Lithology Content Model v0.9: http://repository.usgin.org/sites/default/files/dlio/files/2012/u83/boreholelithintervaltemplate0.9schema_match_0.zip\",\n\t\"license_title\":
